import { Component } from '@angular/core';

@Component({
  selector: 'app-inicio-sesion',
  templateUrl: './inicio-sesion.component.html',
  styleUrls: ['./inicio-sesion.component.css']
})
export class InicioSesionComponent {
  email: string = ''; // Inicializar con una cadena vacía
  password: string = ''; // Inicializar con una cadena vacía
  rememberMe: boolean = false;

  onSubmit() {
    // Manejar el envío del formulario
    console.log('Email:', this.email);
    console.log('Password:', this.password);
    console.log('Remember Me:', this.rememberMe);
  }
}
<div class="container">
    <div class="form-container">
        <img src="assets/images/openenglish.png" alt="Logo">
        <h2>Welcome Student</h2>
        <form (ngSubmit)="onSubmit()">
            <div class="form-group">
                <input type="text" class="form-control" placeholder="Email" name="usuario" [(ngModel)]="email" required>
            </div>
            <div class="form-group">
                <input type="password" class="form-control" placeholder="Password" name="contrasena" [(ngModel)]="password" required>
            </div>
            <button type="submit" class="btn btn-danger btn-block">Log In</button>
            <div class="options">
                <label>
                    <input type="checkbox" name="remember" [(ngModel)]="rememberMe"> Remember Me
                </label>
                <span>|</span>
                <a href="#">Password Reset</a>
            </div>
        </form>
    </div>
</div>
